import React from "react";
import "./productcare.css";

export const ProductCare = () => {
  return (
    <div className="productcare-container">
      <div className="care-tint">
        <span>Automotive Tint Care Information</span>
      </div>

      <div className="care-ppf">
        <span>Paint Protection Film Care Information</span>
      </div>
    </div>
  );
};
